import React from "react";
import {
  Chart,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Line } from 'react-chartjs-2';

export default class EntitySideDetail extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      uptimeChart: {"type":"line","data":{"labels":["10 am","11 am","12 pm","1 pm","2 pm","3 pm","4 pm","5 pm","6 pm","7 pm","8 pm","9 pm"],"datasets":[{"label":"Uptime","data":[100,100,100,100,100,100,100,100,100,100,100,100],"borderColor":"green","backgroundColor":"green"}]},"options":{
          responsive: true,
          plugins: {
            legend: {
              position: 'top',
            },
            title: {
              display: true,
              text: 'Chart.js Line Chart',
            },
          },
        }}
    }

  }

  render() {
    return (
      <div className="class-detail side-detail">
        <h5>
          <span>Uptime</span>
          <a
            className="link"
            style={{ float: "right" }}
            data-bind="text: $root.deviceSelectedChartPeriod, click: $root.toggle_NetworkingDeviceSelectedChartPeriod"
          >
            Hourly
          </a>
        </h5>

        <Chart
            type={this.state.uptimeChart.type}
            options={this.state.uptimeChart.options}
            data={this.state.uptimeChart.data}
            width={'656px'}
            height={'328px'}
            style={{ display: 'block', boxSizing: 'border-box', height: '164px', width: '328px' }}
        />

        <h5>Activity</h5>

        <div className="inbox-task" data-bind="css: {'recentFeed': IsRecent">
          <div className="forms">
            <div className="min_foto">
              <img
                className="dwimg"
                data-bind="attr:{src: '/ProfileImages/' + UserId}"
                src="https://prabook.com/web/show-photo-icon.jpg?id=1918927&width=220&cache=true"
                alt={"profile picture"}
              />
            </div>
            <h5>
              <span data-bind="text: UserId">Jeff Bezos</span>
            </h5>
            <h4>
              <span data-bind="text: Description">Updated Device Details</span>
            </h4>
            <h5>
              <span data-bind="text: FrienlyDate">1 hours ago</span>
            </h5>
          </div>
        </div>
      </div>
    );
  }
}
